激光扫地机

激光扫地机数据分为实时数据和历史记录数据。这两种数据都包含了地图数据和路径数据，以文件的形式存储在 OSS 上。
其中实时数据的地图和路径是分别存储在不同文件内的，历史数据的地图和路径是存储在同一个文件内的，根据指定规则进行拆分读取地图和路径数据。
建议所有接口在initCloudConfig成功之后调用，配置信息的有效期半个小时失败后updateCloudConfig

