【extend说明】
extend是一个扩展字段可以和设备透传（ 例如：{"map_id":123,"layout_size":4589,"route_size":1024} ）
layout_size表示地图文件大小，即文件中地图数据的size
route_size表示路径文件大小，即文件中路径数据的size
读取历史数据的文件时根据layout_size和route_size分别读取地图数据和路径数据
